import React, {useState, useMemo} from 'react';
import DropDown from '../components/DropDown';
import Data from '../components/Data';

const Home = () => {
	// handleFilter = (value) => {
	// 	console.log("Home",value);
	// }
	const [getValue, setGetValue] = useState("");

		return(
			<React.Fragment>
				<DropDown onSelect = {(value) => {
						setGetValue(value);					
				}}/>
				<Data />
			</React.Fragment>
		)
	
}

export default Home;
